  return (
    <table className='order-list'>
        <thead className='order-list-thead'>
          <tr>

          </tr>
          
          <td></td>
          <td></td>
        </thead>
        {orderList.map((orderInfo) =>(
          <TableRow orderInfo = {orderInfo}/>
        ))}
    </table>
  )
}

export default Table
